 @PositivePlastic9  Well that's pretty negative for someone with positive in their name haha. Its cool you don't have to be sorry that's your opinion and I respect it.

Everybody isn't going to be able to achieve whatever they want, no arguing that. But the end result in my opinion, is not about achieving everything you want, but rather the person you become trying to achieve it. Just believing that your dreams could be accomplished can be the encouragement that someone needs to start something they have always wanted to do. Who are we to say we all should just give up before we even try? Not even attempt things that seem impossible. How else would we advance as species? 

I am a firm believer that it is much better for someone to fail and learn at something than to be too scared to even try and live with that you whole life. The latter is what being too negative does. That said, this isn't the answer for all things in life (if it was then everyone would be preaching it). Of course there will be scenarios where this isn't applicable. For example, in your scenario I would recommend you to go on a plane if you wanted to fly :p

